import React from "react";
import MyNavLink from "./MyNavLink";

export default function Nav() {
  const pages = [
    { title: "Homepage", path: "/" },
    { title: "Add Data", path: "/data/add" },
    { title: "Tag Data", path: "/data/tag" },
  ];

  const links = pages.map((page) => (
    <li>
      <MyNavLink title={page.title} path={page.path}></MyNavLink>
    </li>
  ));
  return (
    <nav>
      <ul>
        <li>
          <MyNavLink title="Homepage" path="/" />
        </li>
        <li>
          <MyNavLink title="Add Data" path="/data/add" />
        </li>
        <li>
          <MyNavLink title="Tag Data" path="/data/tag" />
        </li>
      </ul>
    </nav>
  );
}

